  false,\n\t\"url\": null,\n\t\"notes\": \"Single-beam bathymetry data along with
  transit satellite navigation data was collected as part of field activity 69002
  (K-0-69-GM) in Gulf of Mexico from 01/17/1969 to 01/29/1969, http://walrus.wr.usgs.gov/infobank/k/k069gm/html/k-0-69-gm.meta.html
  These data are reformatted from space-delimited ASCII text files located in the
  Coastal and Marine Geology Program (CMGP) InfoBank field activity catalog at http://walrus.wr.usgs.gov/infobank/k/k069gm/html/k-0-69-gm.bath.html
  into MGD77T format provided by the NOAA's National Geophysical Data Center(NGDC).
  The MGD77T format includes a header (documentation) file (.h77t) and a data file
  (.m77t). More information regarding this format can be found in the publication
  listed in the Cross_reference section of this metadata file.\",\n\t\"license_title\":
